import React from "react";

const countrie = [
  "South Africa",
  "Zambia",
  "Botswana",
  "Swaziland",
  "Lesotho",
  "Tanzania",
  "Mozambique"
];

const renderOptions = ({
  countries,
  label,
  input: { onChange, value },
  meta: { touched, error }
}) => (
  <select>
    {countrie.map(country => (
      <option value={country}> {country} </option>
    ))}
  </select>
);

export default renderOptions;
